(53, 'http://lokalreporter.idvl.de/rekordtrunkenheit-679/', 'Ingolstadt (intv) Die Polizei hat am Montag in Ingolstadt zwei Passanten mit rekordverdÃ¤chtigen Alkoholpergeln aufgegriffen. Am spÃ¤ten Nachmittag hatte ein 56-jÃ¤hriger am ZOB randaliert. Als die Polizei eintraf, konnte er sich kaum noch auf den Beinen halten. Er kam mit knapp vier Promille Alkohol im Blut zum AusnÃ¼chtern ins Klinikum.\r\nAm Abend hatten Passanten eine volltrunkene Frau in einer GrÃ¼nanlage an der MaximilianstraÃŸe entdeckt. Weil die 49-jÃ¤hrige aggressiv wurde, holten die Passanten die Polizei. Die Betrunkene hatte 3,52 Promille und musste ebenfalls zum AusnÃ¼chtern ins Klinikum.', '2015-10-06 11:21:40', 'Rekordtrunkenheit', 0),
(40, 'http://lokalreporter.idvl.de/waldsassen-der-abt-rockt-35/', 'Abtprimas Notker Wolf rockt. Mit seiner Band â€žFeedbackâ€œ war er einer der HÃ¶hepunkte des JubilÃ¤umsprogramms in Waldsassen. Hier wurde 150 Jahre klÃ¶sterliche MÃ¤dchenbildung in der Abtei der Zisterzienserinnen gefeiert. In der Sporthalle der Schule kam die Musik und der Abtprimas gut an. Notker Wolf ist seit 2000 oberster ReprÃ¤sentant der Benediktiner weltweit. (ts/Videoreporter: Peter Nickl)\r\n\r\n&nbsp;\r\n\r\n[@cmms_media_sync:190904]\r\n\r\n&nbsp;', '2015-10-06 11:48:11', 'Waldsassen: Der Abt rockt!', 35),
(41, 'http://lokalreporter.idvl.de/schwandorf-segnung-neuer-rettungswagen-38/', 'Ein groÃŸer Tag in der Geschichte der Johanniter Ostbayern: Sie feierten in Schwarzenfeld den Einstieg in den Ã¶ffentlich-rechtlichen Rettungsdienst im Landkreis Schwandorf. Dazu wurde der neue Rettungswagen, eine SanitÃ¤tsdienst-Station oder auch der Logistik-LKW gesegnet. Bis zur Inbetriebnahme der neu zu bauenden Wache am Standort Schwandorf/FreihÃ¶ls werden die Johanniter ihren Rettungsauftrag von der bestehenden Dienststelle in Schwarzenfeld aus wahrnehmen.\r\nFÃ¼r die neue Wache plant der Verband derzeit mit vier hauptamtlichen KrÃ¤ften, die von 9 bis 21 Uhr das ganze Jahr Ã¼ber im Dienst sein werden. (ts)\r\n\r\n(Videoreporter: Alfred BrÃ¶nner)\r\n\r\n[@cmms_media_sync:190838]', '2015-10-06 11:45:57', 'Schwandorf: Segnung neuer Rettungswagen', 38),
(42, 'http://lokalreporter.idvl.de/rechtstipp-was-duerfen-schueler-im-unterricht-und-was-nicht-41/', 'Ab in die Schule, das heiÃŸt es seit ein paar Wochen wieder fÃ¼r die oberpfÃ¤lzer Kinder. Klar ist: Auch fÃ¼r die Schule gibt es gesetzliche Regeln. Zum Beispiel wenn es um Themen wie Diebstahl in der Schule oder um das Handy geht: Darf das ein SchÃ¼ler eigentlich im Unterricht verwenden? Und dÃ¼rfen SchÃ¼ler eigentlich auch wÃ¤hrend des Unterrichts zur Trinkflasche greifen? Die Antworten darauf und weitere Tipps zur Schule bekommen Sie in diesem OTV-Rechtstipp. Rechtsanwalt Stefan Roggenhofer hat hier die Antworten und weitere Informationen parat.Damit es beim Thema Recht und Schule bei Ihnen nicht heiÃŸt: Setzen sechs! (nh)\r\n\r\n[@cmms_media_sync:189977]', '2015-10-06 11:26:10', 'Rechtstipp: Was dÃ¼rfen SchÃ¼ler im Unterricht und was nicht?', 41),
(43, 'http://lokalreporter.idvl.de/amberg-polizei-verhindert-konfrontation-bei-eishockey-spiel-44/', 'Eigentlich war es nur ein Freundschaftsspiel zwischen den Eishockey-Vereinen ERSC Amberg und dem EV Pegnitz. Um 18:30 Uhr am Dienstag gingen die Mannschaften deshalb auch motiviert und gut gelaunt auf das Eis. Zwischen den Spielern kam es zu keinen Vorkommnissen, doch die Fans waren scheinbar alles andere als freundschaftlich gesinnt.\r\n\r\nDenn circa zwanzig Amberger Fans hatten sich mit StÃ¶cken bewaffnet und vermummt. Da es immer wieder zu Auseinandersetzungen zwischen den beiden Fangruppen kommt, hatte die Polizei vorsorglich einige EinsatzkrÃ¤fte zur Begleitung der Pegnitzer AnhÃ¤nger zu ihren Bussen gestellt. Dieser Begleitschutz war es dann auch schlieÃŸlich, der die vermummten Amberger bemerkte und vorlÃ¤ufig festnahm. Sie wurden zur Polizeiinspektion Amberg gebracht.\r\n\r\nAus SicherheitsgrÃ¼nden wurden die Kleinbusse der Pegnitzer Fans dann von EinsatzkrÃ¤ften des PolizeiprÃ¤sidiums Oberpfalz bis nach Auerbach begleitet. Dort Ã¼bernahm dann das PolizeiprÃ¤sidium Oberfranken.\r\n\r\nGegen die Amberger Fans laufen jetzt Ermittlungen wegen Landfriedensbruchs. (eg)\r\n\r\n&nbsp;', '2015-10-06 09:53:51', 'Amberg: Polizei verhindert Konfrontation bei Eishockey-Spiel', 44),
(44, 'http://lokalreporter.idvl.de/schwandorf-horsch-investiert-82-millionen-euro-47/', 'Farming, Innovation, Training: Unter diesem Motto wurde das neue FITZentrum der Firma HORSCH in Schwandorf eingeweiht. Das Landtechnik-Unternehmen setzt mit dem neuen GebÃ¤ude fÃ¼r 8,2 Millionen Euro sein Augenmerk auf Innovation. Auf knapp 1.300 Quadratmetern sind unter anderem Seminar- und SchulungsrÃ¤ume sowie BÃ¼roflÃ¤chen entstanden. Daneben werden 1500 Quadratmetern als Ausstellungshalle mit Kantine genutzt. (aw)\r\n\r\n[@cmms_media_sync:190824]', '2015-10-06 09:37:23', 'Schwandorf: Horsch investiert 8,2 Millionen Euro', 47),
(45, 'http://lokalreporter.idvl.de/amberg-fit-und-aktiv-auch-mit-50-50/', 'Im Amberger Congress Centrum ist am Sonntag der â€ž50+ fit und aktiv-Tagâ€œ abgehalten worden. Es war die 3. Messe dieser Art in Amberg. FrÃ¼her gab es hier die sogenannten Seniorentage. Die Organisatoren wollten aber auch das jÃ¼ngere Publikum ab 50 ansprechen. Das Konzept wurde geÃ¤ndert, das BÃ¼hnenprogramm mit den Darbietungen verjÃ¼ngt und das Angebot von Seiten der Vereine, Organisationen und Firmen angepasst.\r\n\r\nLaut Organisator Herbert Holler hat sich die KonzeptÃ¤nderung gelohnt. Etwa 2000 Menschen besuchten die Messe 50+. Mit zum Erfolg beigetragen hat auch das BÃ¼hnenprogramm. Dort prÃ¤sentierten sich mehrere Vereine, Tanzgruppen, Fitnessstudios oder Tanzschulen. Bewegung, so die Botschaft, hilft, lÃ¤nger gesund zu bleiben. (tb)\r\n\r\n&nbsp;\r\n\r\n[@cmms_media_sync:190874]', '2015-10-06 09:34:51', 'Amberg: Fit und aktiv auch mit 50Plus', 50),
(46, 'http://lokalreporter.idvl.de/ipflheim-vorbildliche-waldbewirtschaftung-ausgezeichnet-53/', 'Ein Spaziergang durch den Wald und dabei frische Luft schnappenâ€¦Der Wald ist ein Ort zum Erholen. Aber nicht nur das: Der Wald ist zugleich auch wichtiger Rohstofflieferant. Alles wichtige GrÃ¼nde also warum es sich lohnt, den Wald zu schÃ¼tzen. Richard Beer aus Ipflheim weiÃŸ, wie das am besten klappt. Er hat dieses Jahr sogar den Staatspreis fÃ¼r vorbildliche Waldbewirtschaftung erhalten und seine Ziele jetzt Vertretern aus Politik, Jagd- und UmweltverbÃ¤nden vorgestellt. (sd)\r\n\r\n[@cmms_media_sync:190507]', '2015-10-06 09:33:33', 'Ipflheim: Vorbildliche Waldbewirtschaftung ausgezeichnet', 53),
(20, 'http://lokalreporter.idvl.de/parkstein-umsatz-von-witron-erneut-gestiegen-56/', 'Die Zahlen, die es bei der Pressekonferenz von Witron in Parkstein am Vormittag zu hÃ¶ren gab,sind sehr gut. Demnach lag der weltweite Umsatz des Unternehmens bei rund 350 Millionen Euro. Ein Plus von 32 Prozent. Auch die Zahl der Mitarbeiter ist demnach gestiegen. Lag die Mitarbeiterzahl des Parksteiner Familienunternehmens Ende 2013 noch bei rund 2.000 Menschen weltweit, so waren es ein Jahr spÃ¤ter bereits fast 2.400.\r\n\r\nDas Unternehmen, das Logistiksysteme entwickelt und vertreibt, steht also sehr gut da. Laut GeschÃ¤ftsfÃ¼hrer Helmut Prieschenk ist das Ziel jetzt, den Umsatz und die QualitÃ¤t zu halten. Expandieren innerhalb kÃ¼rzester Zeit wolle man nicht. Schritt fÃ¼r Schritt wachsen â€“ dieses Motto gilt auch nach wie vor im Familienunternehmen Witron in Parkstein.\r\n\r\nFirmengrÃ¼nder Walter Winkler zeigte sich bei der Pressekonferenz stolz auf sein Unternehmen. Die ZuverlÃ¤ssigkeit der OberpfÃ¤lzer habe mit dazu beigetragen, dass die Firma gut dastehe. Witron sei fÃ¼r die Arbeitnehmer auch sehr interessant, weshalb FachkrÃ¤ftemangel derzeit kein Thema sei. (tb)\r\n\r\n[@cmms_media_sync:190742]', '2015-10-05 14:24:26', 'Parkstein: Umsatz von WITRON erneut  gestiegen', 56),
(21, 'http://lokalreporter.idvl.de/amberg-reservistenmusikzug-oberpfalz-spielt-fuer-den-guten-zweck-59/', 'FÃ¼r den guten Zweck haben die Musiker des Reservistenmusikzuges Oberpfalz im Stadttheater Amberg gespielt. Zu Gunsten des Sozialdienstes Katholischer Frauen e.V. interpretierten sie Werke aus verschiedenen Epochen.\r\nDer musikalische Leiter des Musikzuges Christian Ziegler schÃ¤tzt die Spendeneinnahmen auf etwa 800â‚¬. Das nÃ¤chste Benefizkonzert werden die Reservisten am 6. November in Schwandorf spielen.\r\n\r\n(Videoreporter: Alfred BrÃ¶nner/eg)\r\n\r\n[@cmms_media_sync:190724]', '2015-10-05 14:12:17', 'Amberg: Reservistenmusikzug Oberpfalz spielt fÃ¼r den guten Zweck', 59),
(22, 'http://lokalreporter.idvl.de/oberpfalz-kulturfoerderpreis-verliehen-62/', 'Die nÃ¶rdliche Oberpfalz ist Heimat von KÃ¼nstler und Kreativen. Das zeigt jetzt auch die Verleihung des KulturfÃ¶rderpreises des Bezirk Oberpfalz in Hemau. Denn zwei der drei PreistrÃ¤ger kommen aus der Region. Ausgezeichnet wurden die Original BauernsfÃ¼nfer aus dem Landkreis Amberg-Sulzbach und das Schwandorfer Marionettentheater.\r\n\r\nMit seinen StÃ¼cken in Mundart und den eigens kreierten Marionetten sei das Schwandorfer Theater etwas ganz besonderes, heiÃŸt es im Jury-Urteil. Die Original BauernsfÃ¼nfer aus Edelsfeld brÃ¤chten pfiffige Mundart-Texte auf die BÃ¼hne und wÃ¼rden dabei traditionelle Volksmusik mit modernen EinflÃ¼ssen mischen. BezirkstagsprÃ¤sident Franz LÃ¶ffler Ã¼berreichte den Gewinnern ein Preisgeld in HÃ¶he von 3.500â‚¬.\r\n\r\nDer dritte KulturfÃ¶rderpreistrÃ¤ger ist der KÃ¼nstler JÃ¼rgen BÃ¶hm aus KallmÃ¼nz. Das Ehepaar VÃ¶lkl aus TÃ¤nnesberg bekam auÃŸerdem den Denkmalpreis fÃ¼r die Sanierung des sogenannten â€žLedereranwesens.â€œ (eg)\r\n\r\n[@cmms_media_sync:190759]', '2015-10-05 13:58:00', 'Oberpfalz: KulturfÃ¶rderpreis verliehen', 62),
(47, 'http://lokalreporter.idvl.de/coburg-verkehrslandeplatz-thema-im-stadtrat-396/', '<p>Der Coburger Stadtrat befasst sich aktuell wieder mit dem Coburger Verkehrslandeplatz. Kernpunkt ist dabei ein Beschluss des Feriensenates vom 7. August.</p><p><!--more--></p><p>Der Feriensenat hatte beschlossen, bis 2025 nicht aus der Projektgesellschaft Verkehrslandeplatz Coburg auszusteigen. Sollte der Stadtrat diesen Beschluss jetzt revidieren, ist der Weg frei fÃ¼r das BÃ¼rgerbegehren das genau diesen Ausstieg fordert. Die Initiatoren des BÃ¼rgerbegehrens â€žRettet die Brandensteinsebeneâ€œ haben Ã¼ber 2.800 Unterschriften gesammelt â€“ 500 mehr als nÃ¶tig waren. Diese mÃ¼ssen allerdings noch auf ihre RechtmÃ¤ÃŸigkeit geprÃ¼ft werden.</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-06 11:43:54', 'Coburg: Verkehrslandeplatz wieder Thema im Stadtrat', 396),
(48, 'http://lokalreporter.idvl.de/goessweinstein-lkr-forchheim-frau-bei-unfall-schwer-verletzt-399/', '<p>Eine 57-jÃ¤hrige Suzuki-Fahrerin verunglÃ¼ckte am Montag Morgen (05. Oktober) auf der OrtsverbindungsstraÃŸe zwischen Wolkenstein und Moggast. Sie wurde dabei schwer verletzt.</p><p><!--more--></p><p>Vermutlich aufgrund Ã¼berhÃ¶hter Geschwindigkeit kam sie mit ihrem Fahrzeug von der Fahrbahn ab, prallte mit dem Dach gegen die BÃ¶schung und landete anschlieÃŸend wieder auf den RÃ¤dern. Da die Fahrerin nicht angeschnallt war, wurde sie durch ihr Fahrzeug geschleudert und schwer verletzt. Sie wurde mit dem Rettungshubschrauber in ein Krankenhaus nach Erlangen geflogen. WÃ¤hrend der Unfallaufnahme wurde die StraÃŸe fÃ¼r zwei Stunden komplett gesperrt. Der Gesamtschaden liegt bei etwa 5.000 Euro.</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-06 09:57:12', 'GÃ¶ÃŸweinstein (Lkr. Forchheim): Frau bei Unfall schwer verletzt', 399),
(23, 'http://lokalreporter.idvl.de/brose-baskets-trainer-andrea-trinchieri-verlaengert-402/', '<p>Der Deutsche Basketball-Meister aus Bamberg hat mit Trainer Andrea Trinchieri vorzeitig verlÃ¤ngert. Ausstiegsklausel raus, ein Jahr drauf.</p><p><!--more--></p><p>Der Italiener bindet sich bis zum Ende der Saison 2016/2017 fest an die Brose Baskets. Da passt der gelungene Auftakt in die neue Serie prima ins Bild. 79-63 gewinnen die DomstÃ¤dter in Braunschweig.</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-05 18:30:41', 'Brose Baskets: Trainer Andrea Trinchieri verlÃ¤ngert', 402),
(24, 'http://lokalreporter.idvl.de/landkreis-bamberg-mehrere-baeckereien-ausgeraubt-405/', '<p>Gleich auf mehrere BÃ¤ckereifilialen hatten es Ã¼bers Wochenende bislang Unbekannte abgesehen. In allen FÃ¤llen war wohl Bargeld das Ziel der Einbrecher. Die Kripo Bamberg hat die Ermittlungen zu den EinbrÃ¼chen in Oberhaid, PÃ¶deldorf und Strullendorf aufgenommen und bittet um Hinweise aus der BevÃ¶lkerung.</p><p><!--more--></p><p><strong>Einbruch 1: Oberhaid</strong></p><p>In Oberhaid verschafften sich die ungebetenen GÃ¤ste gewaltsam Zutritt zu einer BÃ¤ckereifiliale in einem Discountmarkt in der StraÃŸe â€žGrabenseeâ€œ. Offensichtlich zielgerichtet machten sie sich an einem Tresor in den BÃ¼rorÃ¤umen zu schaffen. Mit Bargeld gelang den Einbrechern unerkannt die Flucht.</p><p><strong>Einbruch 2:Â PÃ¶deldorf<br /> </strong></p><p>Eine weitere BÃ¤ckereifiliale, ebenfalls untergebracht in einem Discountmarkt, war das Ziel von bislang Unbekannten in der StraÃŸe â€žSchlemmerwiesenâ€œ im Litzendorfer Ortsteil PÃ¶deldorf. Auch hier gelangten die TÃ¤ter mit Gewalt in die RÃ¤umlichkeiten der Filiale und suchten nach Bargeld. Mit einer Geldmappe, in der sich die letzten Tageseinnahmen und Wechselgeld befanden flÃ¼chteten die Eindringlinge.</p><p><strong>Einbruch 3: Strullendorf</strong></p><p>In der Martin-Luther-StraÃŸe in Strullendorf gingen die Einbrecher nach dem gleichen Muster vor. Ãœber ein gewaltsam geÃ¶ffnetes Fenster kamen die bislang Unbekannten in die BÃ¤ckereifiliale und entwendeten einen kompletten Tresor. Allerdings befand sich darin nur eine geringe Menge Bargeld.</p><p><strong>Die Polizei ermittelt</strong></p><p>In allen drei FÃ¤llen ermittelt die Kriminalpolizei Bamberg und prÃ¼ft derzeit mÃ¶gliche ZusammenhÃ¤nge. Den Sachschaden beziffern die Ermittler derzeit mit etwa 1.000 Euro. Zeugen, die im Bereich der Tatorte verdÃ¤chtige Personen und/oder Fahrzeuge beobachtet haben, melden sich bei der Kripo Bamberg unter der Telefonnummer 0951/9129-491.</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-05 17:15:42', 'Landkreis Bamberg: Mehrere BÃ¤ckereien ausgeraubt', 405),
(25, 'http://lokalreporter.idvl.de/wunsiedel-neonazis-wollen-wieder-marschieren-408/', '<p>Am 14. November soll die Stadt Wunsiedel erneut zum Ziel einer Neonazi-Demonstration werden. Das hat die Stadt auf Nachfrage von TVO bestÃ¤tigt. Man befinde sich gerade in der PrÃ¼fungsphase, heiÃŸt es von deren Seite.</p><p><!--more--></p><p>Offenbar wird die Veranstaltung dabei aus dem Umfeld der Vereinigung â€žDer dritte Wegâ€œ, der Nachfolgeorganisation des verbotenen rechtsextremen Freien Netzes SÃ¼d, organisiert. Geplant ist demnach ein Fackelmarsch zum sogenannten â€žHeldengedenkenâ€œ. Bis 2011 befand sich in Wunsiedel das Grab des Hitler-Stellvertreters Rudolf-HeÃŸ. Deshalb ist die Stadt fast schon zu einem Wallfahrtsort fÃ¼r Rechtsradikale geworden. Durch die GrabauflÃ¶sung erhoffte sich Wunsiedel eigentlich nicht mehr zum Mittelpunkt von solchen rechtsextremen Veranstaltungen zu werden.</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-05 16:23:30', 'Wunsiedel: Neonazis wollen wieder marschieren', 408),
(26, 'http://lokalreporter.idvl.de/konradsreuth-lkr-hof-grossbrand-hat-wohl-technische-ursache-411/', '<p>Die umfangreichen und aufwendigen Ermittlungen des Brandfahnders der Kriminalpolizei Hof deuten bislang auf eine technische Ursache hin. Anhaltspunkte fÃ¼r andere Brandursachen gibt es derzeit nicht.</p><p><!--more--></p><p><strong>Kabel lÃ¶ste Brand aus</strong></p><p>Im Zuge der Tatortarbeit ergaben sich fÃ¼r den zustÃ¤ndigen Brandfahnder eindeutige Hinweise darauf, dass das Feuer von einem Kabel ausging. Dies war in einer der beschÃ¤digten Scheunen am Stromnetz angeschlossen. In der Nacht vom 26. auf den 27. September kam es beim Brand eines Scheunenkomplexes zu einem Sachschaden von mindestens 120.000 Euro. Eine 78-jÃ¤hrige Bewohnerin zog sich leichte Verletzungen zu. Die Ermittlungen der Kriminalpolizei Hof dauern noch an.</p><p><strong>TVO-User-Video</strong></p><p>Ein Anwohner filmte den Brand in der Nacht...</p><p>[@cmms_media_sync:161044]</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-05 15:35:11', 'Konradsreuth (Lkr. Hof): GroÃŸbrand hat wohl technische Ursache', 411),
(27, 'http://lokalreporter.idvl.de/warmensteinach-lkr-bayreuth-zwei-einbrueche-in-ferienhaeuser-414/', '<p>Zwei WochenendhÃ¤user am sÃ¼dlichen Ortsrand mit den darin befindlichen ElektrogerÃ¤te sowie Uhren waren vergangene Woche das Ziel bislang unbekannter Einbrecher. Die Kripo Bayreuth hat die Ermittlungen Ã¼bernommen.</p><p><!--more--></p><p><strong>In FerienhÃ¤user eingestiegen</strong></p><p>Im Zeitraum zwischen Sonntag und dem vorangegangenen Wochenende nutzten die Unbekannten die Abwesenheit der Besitzer zweier Ferienanwesen im HÃ¼hnleinsweg, um sich gewaltsam Zutritt zu den GebÃ¤uden zu verschaffen. In beiden FÃ¤llen hatten es die Einbrecher auf ElektronikgerÃ¤te wie Notebooks, Laptops und Fotoapparate, aber auch auf Uhren abgesehen. Mit Beute im Wert eines niedrigen, vierstelligen Eurobetrags gelang den Dieben schlieÃŸlich unerkannt die Flucht.</p><p><strong>Polizei bittet um Mithilfe</strong></p><p>Zeugen, die im Zeitraum von vorletzten Sonntag (27. September / 11 Uhr) bis letzten Sonntag (04. Oktober / 9:00 Uhr) verdÃ¤chtige Wahrnehmungen im HÃ¼hnleinsweg oder der nÃ¤heren Umgebung gemacht haben, melden sich bitte bei der Bayreuther Kripo unter der Telefonnummer 0921/506-0.</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-05 14:45:10', 'Warmensteinach (Lkr. Bayreuth): Zwei EinbrÃ¼che in FerienhÃ¤user', 414),
(28, 'http://lokalreporter.idvl.de/bad-rodach-lkr-coburg-crash-von-auto-und-zug-417/', '<p>GlÃ¼cklicherweise nur Sachschaden entstand am Montag um 09:28 Uhr bei einem ZusammenstoÃŸ zwischen einem Personenzug und einem Audi am BahnÃ¼bergang Wiesenweg.</p><p><!--more--></p><p><strong>Autofahrer Ã¼bersah den Zug</strong></p><p>Der 48-jÃ¤hrige Audi-Fahrer Ã¼bersah beim Ãœberqueren des BahnÃ¼bergangs in Richtung SÃ¼den den von Coburg in Richtung Bahnhof Bad Rodach fahrenden Triebwagen. Dabei touchierte der Triebwagen den Pkw an der linken Fahrzeugseite im Heckbereich. Es entstand ein Schaden von 5.000 Euro am Pkw. Am Triebwagen entstand kein Schaden.</p><p><strong>BahnÃ¼bergang mehrere Stunden gesperrt</strong></p><p>Der Wiesenweg war fÃ¼r mehr als eineinhalb gesperrt, da die Streckenfreigabe nach Unfallaufnahme von der Polizei auch noch durch einen Notfallmanager der Deutschen Bahn veranlasst werden musste. Bei dem ZusammenstoÃŸ befand sich neben dem TriebfahrzeugfÃ¼hrer lediglich ein Fahrgast im Zug. Beide kamen, ebenso wie der Audi-Fahrer, mit dem Schrecken davon. Gegen den Audi-Fahrer wird nun wegen eines Vergehens des gefÃ¤hrlichen Eingriffs in den Bahnverkehr ermittelt.</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-05 13:37:28', 'Bad Rodach (Lkr. Coburg): Crash von Auto und Zug', 417),
(1, 'http://lokalreporter.idvl.de/burgkunstadt-lkr-lichtenfels-jan-park-skateranlage-eingeweiht-420/', '<p>Es ist der Lebenstraum des damals zwÃ¶lfjÃ¤hrigen Jan GrÃ¼nwald aus Burgkunstadt gewesen â€“ ein Skaterpark in seiner Heimatstadt. Drei Jahre nach seinem tragischen Tod nun wurde die nach ihm benannte Jan-Park-Skateranlage eingeweiht.</p><p><!--more--></p><p>Die Anlage ist das erste umgesetzte Projekt des integrierten stÃ¤dtebaulichen Entwicklungskonzepts und zudem ein SchlÃ¼sselprojekt der Jugendbeteiligung. Denn in Zusammenarbeit von Experten und den spÃ¤teren jugendlichen Nutzern entstand ein Parcours, der fÃ¼r AnfÃ¤nger wie Profis interessant ist. Mehr als 300 GÃ¤ste waren bei der Einweihung dabei und auch wir haben uns die Anlage angeschaut. Mehr ab 18:00 Uhr in "Oberfranken Aktuell".</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-05 13:08:08', 'Burgkunstadt (Lkr. Lichtenfels): Jan-Park-Skateranlage eingeweiht', 420),
(2, 'http://lokalreporter.idvl.de/bayreuth-einbrecher-steigen-in-gaststaette-ein-423/', '<p>Auf ElektrogerÃ¤te und den Inhalt der Gefriertruhe hatten es bislang unbekannte Einbrecher abgesehen, als sie in der Nacht zum Freitag (01./02. Oktober) in eine GaststÃ¤tte unweit des Berliner Platzes einstiegen. Die Kripo Bayreuth hat die Ermittlungen Ã¼bernommen und sucht Zeugen.</p><p><!--more--></p><p><strong>Einbrecher dringen Ã¼ber Fenster ein</strong></p><p>Am Freitagmorgen bemerkte der Besitzer eines Restaurants in der Carl-SchÃ¼ller-StraÃŸe, dass sich die Unbekannten in der Nacht Ã¼ber ein Fenster im SanitÃ¤rbereich Zutritt zu den GastrÃ¤umen des Lokals verschafft hatten. Hier brachten sie einen Fernseher sowie ein Smartphone in ihren Besitz und bedienten sie sich zudem an den EssensvorrÃ¤ten aus dem Gefrierschrank, bevor sie schlieÃŸlich unerkannt von dannen zogen.</p><p><strong>Die Kripo Bayreuth sucht Zeugen</strong></p><p>Die Kripo Bayreuth fragt:</p><ul><li>Wer hat in der Zeit von Donnerstag gegen 23:00 Uhr bis Freitagmorgen etwa 9:00 Uhr Wahrnehmungen im Bereich der Carl-SchÃ¼ller-StraÃŸe oder des Berliner Platzes gemacht, die mit dem Einbruch in Verbindung stehen kÃ¶nnten?</li><li>Wer hat in diesem Zeitraum dort verdÃ¤chtige Personen beobachtet?</li></ul><p>Hinweise nimmt die Bayreuther Kriminalpolizei unter der Telefonnummer 0921/506-0 entgegen.</p><p>&nbsp;</p><div><hr /><a title="TVO bei Facebook" href="http://www.fb.com/fb.tvo" target="_blank"><img src="http://www.tvo.de/storage/thumbs/r:1366130542/28094.jpg" alt="" width="440" height="50" /></a><br /><div class="fb-like" data-href="http://www.fb.com/fb.tvo" data-send="true" data-width="450" data-show-faces="false"><hr /><p>&nbsp;</p></div></div>', '2015-10-05 12:46:43', 'Bayreuth: Einbrecher steigen in GaststÃ¤tte ein', 423),
