(51, 'http://lokalreporter.idvl.de/ingolstadt-nordbahnhof-wird-oefters-angefahren-586/', 'Das sind gute Nachrichten fÃ¼r Pendler: Zum diesjÃ¤hrigen Fahrplanwechsel werden mehr ZÃ¼ge zwischen dem IngolstÃ¤dter Nord- und Hauptbahnhof fahren.\r\nDer private Anbieter "Agilis" wird 32 zusÃ¤tzliche Fahrten in der Woche anbieten. Damit wird der IngolstÃ¤dter Nordbahnhof ab dem 13. Dezember mindestens einmal pro Stunde angefahren. Auch die umliegenden Landkreis sollen davon profitieren Desweiteren soll auch die Busanbindung des Nordbahnhofs verbessert werden.', '2015-10-06 07:07:50', 'Ingolstadt: Nordbahnhof wird Ã¶fters angefahren', 586),
(52, 'http://lokalreporter.idvl.de/eichstaett-der-landkreis-sorgt-vor-590/', '<p align="LEFT">Mittlerweile geht man alleine in diesem Jahr von 1,5 Millionen Asylsuchenden in Deutschland aus: Der Landkreis EichstÃ¤tt mÃ¶chte deshalb fÃ¼r alles gewappnet sein. Dort hat man jetzt dem Bau von weiteren FlÃ¼chtlingsunterkÃ¼nften zugestimmt: Eine kÃ¶nnte womÃ¶glich auf einem GrundstÃ¼ck nahe der KÃ¶schinger Klinik entstehen. Allerdings mÃ¼sste Anfang des Jahres erst eine Ausschreibung erfolgen, der Bau wÃ¼rde dann wohl nochmal bis zu vier Monate dauern. Die nÃ¤chsten ContainerdÃ¶rfer werden aber bereits im November errichtet: In Beilngries, GroÃŸmehring und Gaimersheim. Bis zum Februar folgen noch Mindelstetten, PfÃ¶rring und Preith. Ob der Freistaat die Kosten dafÃ¼r Ã¼bernimmt, ist bislang noch unklar.</p>', '2015-10-06 06:57:25', 'EichstÃ¤tt: Der Landkreis sorgt vor', 590),
