(30, 'http://lokalreporter.idvl.de/tiersegnung-im-kapuzinerkloster-691/', 'Ingolstadt (intv) Ein jedes Tier in BedrÃ¤ngnis hat die gleichen Rechte auf Schutz. Das war der Leitgedanke von Franz von Assisi, dem MitbegrÃ¼nder des Franziskanerordens. Er liebte Tiere wie kein Zweiter. Deshalb wurden zum Fest des Heiligen Franziskus Ã¼berall in Deutschland an genau diese gedacht. So auch am gestrigen Sonntag im Kapuzinerkloster in Ingolstadt. Die City Seelsorge Ingolstadt lud die Besitzer groÃŸer und kleiner Tiere zu einer Segnung ein.\r\n\r\n[@cmms_media_sync:110056]', '2015-10-05 16:54:17', 'Tiersegnung im Kapuzinerkloster', 691),
