(33, 'http://lokalreporter.idvl.de/drescherfest-700/', 'Ottersried (intv) Auf geht`s zum Drescherfest hieÃŸ es am Samstag in Ottersried. Dabei kamen unter anderen historische Dreschwagen zum Einsatz, eine Zeitreise in die Getreideverarbeitung annodazumal. Zeigen wie`s damals zugegangen ist auf Feld und Hof, das haben sich die Herrn vom Verein â€žAgar-Oldiesâ€œ auf die Fahnen geschrieben. Wie hart die Arbeit war konnten die GÃ¤ste am eigenen Leib erleben. Mit dem Dreschflegel das Getreide herausholen, das war und ist schweiÃŸtreibend. Eine Erleichterung fÃ¼r Landwirte war dann der Einsatz von Dreschmaschinen, die tiptop gepflegt zum Einsatz kamen. So war das Drescherfest eiin Blick zurÃ¼ck auf eine Zeit ,die unsere HeimatÂ maÃŸgeblich geprÃ¤gt hat.\r\n\r\n[@cmms_media_sync:110054]', '2015-10-05 16:00:28', 'Drescherfest', 700),
(34, 'http://lokalreporter.idvl.de/unterm-messer-703/', '<p lang="zxx">Neuburg a.d. Donau (intv) Lange waren die filigranen Schnitte als Kunsthandwerk verkannt â€“ mit Hans Lankes feiern sie ihre RÃ¼ckkehr in der Kunstszene. Statt mit dem Pinsel zeichnet der 54-JÃ¤hrige mit Skalpell oder Cutter.</p>\r\n<p lang="zxx">Jedes seiner Werke besteht aus einem einzigen StÃ¼ck Papier oder Pappe, nichts ist nachtrÃ¤glich geklebt. Viele Arbeiten hÃ¤ngen frei im Raum, sodass sie durch den Schatten dreidimensional wirken. Bis zum 1. November stellt er seine scharfkantigen und kontrastreichen Werke im Neuburger Rathausfletz aus.</p>\r\n<p lang="zxx">Die Ausstellung hat Donnerstag und Freitag von 17 bis 19 Uhr, Samstag und Sonntag von 11 bis 19 Uhr geÃ¶ffnet. Der Eintritt ist frei.</p>\r\n<p lang="zxx">[@cmms_media_sync:110041]</p>', '2015-10-05 15:58:36', 'Unterm Messer', 703),
(35, 'http://lokalreporter.idvl.de/glas-im-prozess-sonderausstellung-der-schrobenhausener-kunstpreistraegerin-706/', 'Schrobenhausen (intv) Sie ist weit Ã¼ber die Grenzen Schrobenhausens hinaus bekannt, die GlaskÃ¼nstlerin <a href="http://www.brigitteschuster-glas.de/" target="_blank">Brigitte Schuster</a>. Denn ihre Werke finden sich zum Beispiel am rÃ¶mischen Limes im AltmÃ¼hltal, vor dem Gaimersheimer Gymnasium oder am Hopfenmuseum in Wolnzach. Nun hat die gelernte Glas- und Porzellanmalerin in Ã¼ber einjÃ¤hriger Arbeit eine Sonderausstellung fÃ¼r das Schrobenhausener Pflegschloss konzipiert. Seit gestern erleben die Besucher dort "Glas im Prozess".\r\n\r\nDen Anlass bildete die Verleihung des Kunstpreises durch die Stadt Schrobenhausen im Januar 2014. "Das war fÃ¼r mich der ideale Anreiz, um sÃ¤mtliche Facetten zu prÃ¤sentieren, die Glas zeigen kann", so Schuster. Denn als GlaskÃ¼nstlerin ist sie bereits seit Ã¼ber 40 Jahren tÃ¤tig. Der Querschnitt in der aktuellen Sonderausstellung besteht aus Objekten im Sandgussverfahren, Bildern mit Glasmalerei und architektonischen Gestaltungsbeispielen.\r\n\r\nSo sind verkleinerte Varianten von Hausfassaden, Treppenhausverkleidungen oder groÃŸformatigen Wandbildern zu sehen. Die Originale finden sich zum Beispiel im Schrobenhausener Kunsthof, bei Regens Wagner Hohenwart oder im Empfangsbereich der Firma Bauer. "So etwas kann ich natÃ¼rlich nicht zuhause im Atelier machen", sagt die 66-jÃ¤hrige. Darum ist Schuster regelmÃ¤ÃŸig zu Gast in der Mayerâ€™schen Hofkunstanstalt MÃ¼nchen. Dort stehen nicht nur passende Rohstoffe, sondern auch das das nÃ¶tige technische Equipment bereit. FÃ¼r Kunstwerke, die durch Schmelztechniken entstehen, reist Schuster zusammen mit Ehemann Anton gerne mal in den Bayerischen Wald oder nach Tschechien - "dort gibt es geeignete GlashÃ¼tten".\r\n<h1>Aktionstage im Pflegschlossmuseum</h1>\r\nDie Sonderausstellung "Glas im Prozess" ist bis zum 22. November im Pflegschloss zu sehen (Am Hofgraben, Schrobenhausen). GeÃ¶ffnet ist jeweils Mittwoch, Samstag und Sonntag von 14 bis 16 Uhr. Drei Aktionstage sind bei freiem Eintritt geplant:\r\n\r\nSo 18.10.2015, Thema: Feuer und Sand\r\nSo 25.10.2015, Thema: Glaskunst in der Architektur\r\nSo 08.11.2015, Thema: Malen mit Licht\r\n\r\nDabei wird die KÃ¼nstlerin jeweils gegen 14 Uhr FÃ¼hrungen anbieten und Ã¼ber den Entstehungsprozess der Glaskunst informieren. Am 22.11. soll die Ausstellung mit europÃ¤ischer Folklore der Musikgruppe "Cheskinga Dradewixpfeiferl" aus KÃ¶sching beendet werden.\r\n<h1>Paarkunst verzaubert</h1>\r\nDie Ausstellung ist Teil der diesjÃ¤hrigen Kulturreihe <a href="http://www.paarkunst.info" target="_blank">Paarkunst</a>, die sich von Dasing Ã¼ber Aichach bis nach Schrobenhausen zieht. Unter dem Motto "Paarkunst verzaubert" sind auch Veranstaltungen fÃ¼r Kinder in der StadtbÃ¼cherei geplant, erklÃ¤rt Claudia Freitag-Mair vom Amt fÃ¼r Kultur und Ã–ffentlichkeitsarbeit. Folgende Termine sind angesetzt (Beginn jeweils 15 Uhr):\r\n\r\nDi 06.10.2015: Schminken und Basteln zum Thema Zaubern\r\nFr 09.10.2015: MÃ¤rchenstunde fÃ¼r Kinder ab 5 Jahren\r\nMo 12.10.2015: Patrick Boywitt von der Regens-Wagner-Stiftung liest zauberhafte Geschichten\r\nFr 16.10.2015: Piratenzauberspektakel mit KÃ¤ptn El Corbo\r\n\r\n[@cmms_media_sync:110063]', '2015-10-05 15:58:13', 'Glas im Prozess: Sonderausstellung der Schrobenhausener KunstpreistrÃ¤gerin', 706),
(36, 'http://lokalreporter.idvl.de/zusaetzliche-zuege-zwischen-ingolstaedter-bahnhoefen-709/', 'Ingolstadt (intv) Ab dem Fahrplanwechsel im Dezember werden zwischen Ingolstadt Hauptbahnhof und Ingolstadt Nord zusÃ¤tzliche ZÃ¼ge fahren. Insgesamt fahren zwischen den beiden BahnhÃ¶fen tÃ¤glich montags bis freitags 32 zusÃ¤tzliche ZÃ¼ge. Ab dem 13. Dezember gibt es dann mindestens einmal in der Stunde einen Zug. Damit sollen Audi BeschÃ¤ftigte besser mit Ã¶ffentlichen Verkehrsmitteln das Werk erreichen. Am Nordbahnhof kÃ¶nnen die Mitarbeiter in den Audi Werksbus umsteigen. Die ZÃ¼ge werden betrieben von der Deutschen Bahn, der Bayerischen Regiobahn und Agilis.\r\n\r\nAuch die FahrplÃ¤ne der Donautalbahn werden dann angepasst. Dadurch soll auch das neue Audi Werk in MÃ¼nchsmÃ¼nster besser angebunden werden. Im Einzelnen gibt es zum Start des Winterfahrplans dort folgende Ã„nderungen:\r\n<ul>\r\n	<li>Der Zug Ulm Hbf (08:31Â Uhr) â€“ Regensburg Hbf (11:31Â Uhr) entfÃ¤llt. DafÃ¼r beginnt der Zug DonauwÃ¶rth (10:04 Uhr) â€“ Regensburg Hbf (12:10 Uhr) bereits in Ulm Hbf (08:48 Uhr).</li>\r\n	<li>Der Zug Ulm Hbf (12:31Â Uhr) â€“ Regensburg Hbf (15:33Â Uhr) verkehrt an Schultagen nur noch zwischen GÃ¼nzburg und Ingolstadt Hbf; an schulfreien Tagen entfÃ¤llt dieser Zug komplett. DafÃ¼r startet der Zug GÃ¼nzburg (13:14 Uhr) â€“ Regensburg Hbf (16:11 Uhr) an Schultagen bzw. DonauwÃ¶rth (14:02 Uhr) â€“ Regensburg Hbf (16:11 Uhr) an schulfreien Tagen kÃ¼nftig bereits in Ulm Hbf (12:48 Uhr).</li>\r\n	<li>Der Zug Regensburg Hbf (08:32Â Uhr) â€“ Ulm Hbf (11:14Â Uhr) entfÃ¤llt. DafÃ¼r wird der Zug Regensburg Hbf (07:45 Uhr) â€“ DonauwÃ¶rth (09:51Â Uhr) nach Ulm Hbf (10:58Â Uhr) verlÃ¤ngert.</li>\r\n	<li>Der Zug Regensburg (12:20Â Uhr) â€“ Ulm (15:14Â Uhr) verkehrt an Schultagen nur noch zwischen Ingolstadt (13:23 Uhr) und DonauwÃ¶rth (14:14 Uhr); an schulfreien Tagen entfÃ¤llt dieser Zug komplett. DafÃ¼r wird der Zug Regensburg (11:45 Uhr) â€“ DonauwÃ¶rth (13:53Â Uhr) nach Ulm (14:58Â 