(3, 'http://lokalreporter.idvl.de/vorsitzender-des-sueddeutschen-schaustellerverbands-lorenz-kalb-feierte-60-geburtstag-925/', '<div class="idvl-editor">\r\n			<div class="block single">\r\n							<div class="slot">\r\n													<div class="element text html"><p>Rund 150 GÃ¤ste erwiesen dem 1. Vorsitzenden des SÃ¼ddeutschen Schaustellerverbandes die Ehre und stieÃŸen mit ihm in der AltstadtfesthÃ¼tte von Haxn Liebermann auf seinen Ehrentag an. Lorenz Kalb feierte seinen 60. Geburtstag bei einem Stehempfang mit Kollegen, Freunden und Wegbegleitern. Ein GruÃŸwort sprachen OberbÃ¼rgermeister Dr. Ulrich Maly, der 2. Vorsitzende des Schaustellerverbandes, Rudi Bergmann, der PrÃ¤sident des Schaustellerdachverbandes DSB, Albert Ritter aus Berlin sowie PrÃ¤sidiumskollege Michael Hempen aus Oldenburg. VolksfestkÃ¶nigin Carina und ihre VorgÃ¤ngerinnen Kathrin Kohlmann und Andrea Konn lieÃŸen es sich nicht nehmen, ebenfalls am Empfang teilzunehmen und ihre GlÃ¼ckwÃ¼nsche zu Ã¼berbringen.</p>\r\n</div>				</div>\r\n					</div>\r\n			<div class="block third">\r\n							<div class="slot">\r\n													<div class="element post media"><img src="http://www.frankenfernsehen.tv/storage/thumbs/345x/r:1443427153/79352.jpg" width="345" height="226" alt=""  /></div>				</div>\r\n							<div class="slot">\r\n													<div class="element post media"><img src="http://www.frankenfernsehen.tv/storage/thumbs/345x/r:1443427143/79348.jpg" width="345" height="224" alt=""  /></div>				</div>\r\n							<div class="slot">\r\n													<div class="element post media"><img src="http://www.frankenfernsehen.tv/storage/thumbs/345x/r:1443427153/79354.jpg" width="345" height="226" alt=""  /></div>				</div>\r\n					</div>\r\n	</div>', '2015-09-28 10:33:00', 'Lorenz Kalb feierte 60. Geburtstag', 925),
(4, 'http://lokalreporter.idvl.de/unentschieden-der-club-spielt-22-gegen-bielefeld-928/', 'Der 1. FC NÃ¼rnberg konnte am Freitag Abend vor heimischer Kulisse zumindest einen Punkt retten. Dank eines Doppelpacks von Guido Burgstaller stand es am Ende 2:2.<!--more-->\r\n\r\nGleich zu Beginn des Spiels kassierten die NÃ¼rnberger ein Gegentor durch Fabian Klos. Dem Bielefelder gelang dann in der 48. Minute der zweite Treffer nach einem groÃŸen Patzer von Kirschbaum, der dem TorschÃ¼tzen den Ball quasi vor die FÃ¼ÃŸe spielte.\r\n\r\nIn aller letzter Minute gelang es dem Club dann das Spiel noch zu wenden - und das ebenfalls mit einem Doppelpack, diesmal durch Guido Burgstaller. Der traf per Kopf in der 83. Minute und konnte dann eine Minute vor regulÃ¤rem Spielende noch den Ausgleichstreffer erzielen.\r\n\r\n&nbsp;', '2015-09-25 21:19:21', 'Unentschieden: Der Club spielt 2:2 gegen Bielefeld', 928),
(5, 'http://lokalreporter.idvl.de/geschichten-der-deutschen-einheit-zeitzeuge-berichtet-am-melanchthon-gymnasium-931/', '<div class="idvl-editor">\r\n			<div class="block single">\r\n							<div class="slot">\r\n													<div class="element post media"><img src="http://www.frankenfernsehen.tv/storage/thumbs/1056x/r:1442996433/79165.jpg" width="1056" height="419" alt=""  /></div>				</div>\r\n					</div>\r\n			<div class="block single">\r\n							<div class="slot">\r\n													<div class="element text html"><p style="text-align: justify;">AnlÃ¤sslich des 25-jÃ¤hrigen JubilÃ¤ums der Deutschen Einheit fÃ¼hren der â€žDeutsche Gesellschaft e.V.â€œ zusammen mit der Bundesregierung eine Veranstaltungsreihe zum Thema <strong>"Geschichten der Deutschen Einheit"</strong> durch. Ein Teil dieses Projektes sind ZeitzeugengesprÃ¤che in Schulen. Die SchÃ¼ler des Melanchthon-Gymnasiums freuen sich am <strong>21. September 2015</strong> in der Zeit von <strong>09.00-10.30 Uhr</strong> Ã¼ber ein moderiertes GesprÃ¤ch mit einem prominenten Zeitzeugen: Christoph Wonneberger ist Pfarrer i. R. und koordinierte von 1986 an die montÃ¤glichen Friedensgebete in der Leipziger Nikolaikirche. Aus diesen entwickelten sich die Montagsdemonstrationen und die Friedliche Revolution im Herbst 1989.â€¨</p>\r\n<p style="text-align: justify;">Vor und nach dem GesprÃ¤ch wird das Infomobil der Bundesregierung Station am Melanchthon-Gymnasium machen. So kÃ¶nnen die SchÃ¼ler vor Ort an einem Quiz zur Deutschen Einheit teilnehmen und zusÃ¤tzliche Informationen bekommen.â€¨</p>\r\n</div>				</div>\r\n					</div>\r\n	</div>', '2015-09-23 10:22:59', 'Geschichten der Deutschen Einheit: Zeitzeuge berichtet am Melanchthon-Gymnasium', 931);
