(6, 'http://lokalreporter.idvl.de/freisprechung-maler-und-lackierer-innung-nuernberg-934/', '<div class="idvl-editor">\r\n			<div class="block third">\r\n							<div class="slot">\r\n									</div>\r\n							<div class="slot">\r\n													<div class="element post media"><img src="http://www.frankenfernsehen.tv/storage/thumbs/345x/r:1442413013/78853.jpg" width="345" height="230" alt=""  /></div>				</div>\r\n							<div class="slot">\r\n									</div>\r\n					</div>\r\n			<div class="block single">\r\n							<div class="slot">\r\n													<div class="element text html"><p><strong>Am 14. September 2015 lud die Maler- und Lackiererinnung NÃ¼rnberg zur feierlichen Ãœbergabe der PrÃ¼fungszeugnisse der Maler- und Lackierergesellen sowie der Ãœbergabe der Abschlusszeugnisse fÃ¼r die Bauten- und Objektbeschichter ein.</strong></p>\r\n<p>Â </p>\r\n<p>Im Hans-Sachs-Saal der Handwerkskammer Mittelfranken empfingen 38 junge Menschen den Gesellenbrief fÃ¼r Maler und Lackierer. Sieben weitere wurden an diesem Abend zum Bauten- und Objektbeschichter. Zu den besonderen EhrengÃ¤sten zÃ¤hlten Christian von Griesheim, Busch &amp; Co., Dr. Wolfgang Setzler, Institutsleiter des Institutes fÃ¼r Absatzforschung und kundenorientiertes Marketing sowie GÃ¼nther Beck von PROSOL Lacke + Farben GmbH. </p>\r\n<p>Nach einer BegrÃ¼ÃŸung von Obermeister Thomas Back, beglÃ¼ckte Christian Sendelbeck, VizeprÃ¤sident der Handwerkskammer Mittelfranken, die zu Ehrenden fÃ¼r die Wahl eines â€žabwechslungsreichen und zukunftssicheren Jobsâ€œ. Zum Thema machte er sich den RÃ¼ckblick auf die dreijÃ¤hrige Ausbildungsphase und endete mit einer instÃ¤ndigen Bitte: â€žBehalten Sie die Fort- und WeiterbildungsmÃ¶glichkeiten im Auge. Das Handwerk ist aktuell in einem schnellen Wandel begriffen, gerade was zum Beispiel das Thema Umweltschutz anbelangt. Und bitte bleiben Sie dem Handwerk treuâ€œ.</p>\r\n</div>				</div>\r\n					</div>\r\n			<div class="block third">\r\n							<div class="slot">\r\n								