e Sorge.â€œ Er blickte zurÃ¼ck auf die Zeit, in der er diese Jugendlichen auf dem Weg zu jungen Erwachsenen begleitet hat. Seine Rede endete mit den Worten: â€žSchade, dass Ihr nÃ¤chstes Jahr nicht noch mal kommt.â€œ</p>\r\n<p class="MsoNormal" style="text-align: justify;">Â </p>\r\n<p class="MsoNormal" style="text-align: justify;"><b style="mso-bidi-font-weight: normal;">Besondere Ehrung</b></p>\r\n<p class="MsoNormal" style="text-align: justify;">FÃ¼r die besonders vorbildliche FÃ¼hrung des Berichtsheftes wurden ausgezeichnet: Juri Kurzwarth und Elisabeth Dotterweich seitens der Maler und Lackierer sowie Heidi Dlouhy der Bauten- und Objektbeschichter. Diese Auszeichnung hat einen besonderen Stellenwert im Handwerk. Auch sauberes Arbeiten und gute Noten sind entscheidend, wer sich Ã¼ber drei Jahre hinweg bemÃ¼ht, kann zunÃ¤chst im Bezirk Mittelfranken eine Auszeichnung im Kampf der einzelnen Innungen erreichen und zuletzt sogar bei der Weltmeisterschaft als bester Nachwuchsgeselle ausgezeichnet werden.</p>\r\n<p class="MsoNormal" style="text-align: justify;"><b style="mso-bidi-font-weight: normal;">Markenwerte und persÃ¶nliche Werte </b></p>\r\n<p class="MsoNormal" style="text-align: justify;"><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>DE</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedT