ption><br />\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false" UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"></w:LsdException><br />\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false" UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"></w:LsdException><br />\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false" UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"></w:LsdException><br />\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false" UnhideWhenUsed="false" QFormat="true" Name="Book Title"></w:LsdException><br />\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"></w:LsdException><br />\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"></w:LsdException><br />\r\n </w:LatentStyles><br />\r\n</xml><![endif]--><!-- [if gte mso 10]></p>\r\n\r\n\r\n\r\n<style>\r\n /* Style Definitions */<br />\r\n table.MsoNormalTable<br />\r\n	{mso-style-name:"Normale Tabelle";<br />\r\n	mso-tstyle-rowband-size:0;<br />\r\n	mso-tstyle-colband-size:0;<br />\r\n	mso-style-noshow:yes;<br />\r\n	mso-style-priority:99;<br />\r\n	mso-style-parent:"";<br />\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;<br />\r\n	mso-para-margin-top:0cm;<br />\r\n	mso-para-margin-right:0cm;<br />\r\n	mso-para-margin-bottom:8.0pt;<br />\r\n	mso-para-margin-left:0cm;<br />\r\n	line-height:107%;<br />\r\n	mso-pagination:widow-orphan;<br />\r\n	font-size:11.0pt;<br />\r\n	font-family:"Calibri","sans-serif";<br />\r\n	mso-ascii-font-family:Calibri;<br />\r\n	mso-ascii-theme-font:minor-latin;<br />\r\n	mso-hansi-font-family:Calibri;<br />\r\n	mso-hansi-theme-font:minor-latin;<br />\r\n	mso-fareast-language:EN-US;}<br />\r\n</style>\r\n\r\n\r\n\r\n<p><![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify;"><b style="mso-bidi-font-weight: normal;">Azubis gefragt</b></p>\r\n<p class="MsoNormal" style="text-align: justify;">FachkrÃ¤ftemangel ist gerade im Bereich des Handwerks eine groÃŸe Aufgabe. Dabei ist der Beruf des Malers und Lackierers lÃ¤ngst nicht mehr kÃ¶rperlich so belastend, wie er es in frÃ¼heren Jahren war. Ein Arbeiten bis zum Rentenalter ist problemlos mÃ¶glich. Die Maler- und Lackiererinnung NÃ¼rnberg stellt sich dem Problem des Nachwuchsmangels und hat bereits Konzepte zur Auszubildendengewinnung. VerstÃ¤rkte PrÃ¤senz in den modernen Medien sowie intensive PersÃ¶nlichkeitsarbeit in den Betrieben sollen kÃ¼nftig den Berufsstand noch attraktiver machen. WÃ¤hrend der dreijÃ¤hrigen Ausbildungsphase sollen die heranreifenden Erwachsenen begleitet werden, beruflich mit Fachwissen aber auch im zwischenmenschlichen Bereich. Christian von Griesheim erwÃ¤hnte, dass bereits erste Erfolge zu feiern sind. Inzwischen ist der Meister gleichwertig mit einem Bachelorabschluss und befÃ¤higt somit direkt zum Einstieg in einen Masterstudiengang.</p>\r\n<p class="MsoNormal" style="text-align: justify;"><b style="mso-bidi-font-weight: normal;">Adieu MÃ¤nnerdomÃ¤ne</b></p>\r\n<p class="MsoNormal" style="text-align: justify;">Von insgesamt 45 Maler- und Lackierergesellen sowie Bauten- und Objektbeschichtern wurden elf jungen Damen die PrÃ¼fungszeugnisse Ã¼berreicht. Die Zahl der Frauen in der jahrelang mÃ¤nnerdominierten Bra', '2015-09-16 16:23:40', 'Freisprechung Maler- und Lackierer-Innung NÃ¼rnberg', 934);
