(37, 'http://lokalreporter.idvl.de/fahrgastbefragung-bei-der-vvm-1263/', 'Vom 10. Oktober bis 1. November 2015 fÃ¼hrt der Verkehrsverbund Mainfranken im gesamten Verbundgebiet eine umfassende VerkehrszÃ¤hlung und Fahrgastbefragung durch. Die Befragungen finden in den Bussen, Bahnen und Haltestellen und BahnhÃ¶fen statt. Mit Fragen Ã¼ber Reiseweg, Fahrkarte und die benutzten Verkehrsmittel ermittelt die VVM neue, grundlegende Erkenntnisse beispielsweise zur Auslastung der StraÃŸenbahnlinien. Der VVM bittet alle FahrgÃ¤ste die Interviewerinnen und Interviewer zu unterstÃ¼tzen. Diese werden FahrgÃ¤ste nicht nach persÃ¶nlichen Daten fragen und kÃ¶nnen sich mit einem Erheber-Ausweis legitimieren. Bei der Befragung handelt es sich nicht um eine Fahrausweiskontrolle, dennoch ist das Zeigen der Fahrkarte erwÃ¼nscht, um die Art der genutzten Fahrkarte fÃ¼r die Umfrage zu erfassen.', '2015-10-05 17:55:00', 'Fahrgastbefragung bei der VVM', 1263),
(38, 'http://lokalreporter.idvl.de/wuerzburg-13-jaehrige-in-schwimmbad-sexuell-genoetigt-taeter-festgenommen-1264/', 'Ein 27-JÃ¤hriger sitzt seit heute wegen des dringenden Verdachts der sexuellen NÃ¶tigung eines Kindes in Untersuchungshaft. Am 29. Septemberwurde er gegen 17.30 Uhr in einem Schwimmbad in der Zellerau auffÃ¤llig. Der 27-JÃ¤hrige hatte sich ofefenbar einer 13-JÃ¤hrigen im Schwimmbecken genÃ¤hert und diese zunÃ¤chst sexuell belÃ¤stigt. Eine dazu gerufene Streife der WÃ¼rzburger Polizei nahm den 27-JÃ¤hrigen, der auch in WÃ¼rzburg wohnhaft ist, vorlÃ¤ufig fest. Die 13-JÃ¤hrige war zunÃ¤chst nicht vernehmungsfÃ¤hig. Nachdem die Tat auch durch Zeugen nicht bestÃ¤tigt werden konnte, musste der 27-JÃ¤hrige zunÃ¤chst wieder in Freiheit entlassen werden. Als die Beamten am Donnerstag das MÃ¤dchen vernehmen konnten, stellte sich heraus, dass der TatverdÃ¤chtige das MÃ¤dchen auch durch sexuelle Handlungen missbraucht haben soll.\r\n\r\nAuf Antrag der WÃ¼rzburger Staatsanwaltschaft wurde daraufhin vom Amtsgericht WÃ¼rzburg am vergangenen Freitag ein Untersuchungshaftbefehl gegen den 27-JÃ¤hrigen erlassen. Polizeibeamte verhafteten den Mann am Montag und lieferten ihn nach der richterlichen ErÃ¶ffnung des Haftbefehls in eine Justizvollzugsanstalt ein.', '2015-10-05 16:26:53', 'WÃ¼rzburg: 13-JÃ¤hrige in Schwimmbad sexuell genÃ¶tigt - TÃ¤ter festgenommen', 1264),
(39, 'http://lokalreporter.idvl.de/sebastian-duernagel-wird-torwarttrainer-im-nachwuchsbereich-des-fc-wuerzburger-kickers-1267/', 'FuÃŸball-Drittligist FC WÃ¼rzburger Kickers treibt die Professionalisierung auch im Nachwuchsbereich weiter voran: Ab sofort wird Sebastian DÃ¼rnagel als Torwarttrainer fÃ¼r das U-23-Team der Rothosen in der Landesliga Nordwest verantwortlich sein und zudem die Nachwuchs-Torleute auf der U-19-Ebene trainieren. Der gebÃ¼rtige Rothenfelser spielte in seiner aktiven Karriere unter anderem fÃ¼r den 1. FC NÃ¼rnberg, Viktoria Aschaffenburg und den WÃ¼rzburger FV.\r\n\r\nViele Erfahrungen sammelte der heute 34-JÃ¤hrige in der Jugendabteilung des 1. FC NÃ¼rnberg, wo er spÃ¤ter auch zum Lizenzspielerkader zÃ¤hlte, und der FuÃŸballschule der Frankfurter Eintracht. â€žIch freue mich sehr auf die Aufgabe als Torwarttrainer im Nachwuchsbereich des FC WÃ¼rzburger Kickers, und mÃ¶chte so einen Beitrag zur Weiterentwicklung der Torwarttalente bei den Kickers leistenâ€œ, sagt DÃ¼rnagel. Somit kann der Keeper-Nachwuchs bei den Rothosen kÃ¼nftig optimal in den spezifischen Trainingseinheiten ausgebildet werden.', '2015-10-05 15:29:55', 'Sebastian DÃ¼rnagel wird Torwarttrainer im Nachwuchsbereich des FC WÃ¼rzburger Kickers', 1267),
(7, 'http://lokalreporter.idvl.de/zweite-basketball-bundesliga-der-damen-bvuk-damen-siegen-nach-aufholjagd-1268/', '<h2 class="title"></h2>\r\n<div class="text">\r\nIn der 18. Minute sagte BVUK-Trainerin Janet Fowler-Michel: â€žIch bin wohl im falschen Filmâ€œ, als die WÃ¼rzburger Spielerinnen einfache Korbleger verlegten und in der Verteidigung nicht prÃ¤sent waren.</div>\r\n<div class="text"></div>\r\n<div class="text">Die GÃ¤ste aus Mainz starteten top motiviert und aggressiv in die Partie und bestimmten von Anfang an das Spielgeschehen. Ãœber 5:10, 10:20 zur Viertelpause konnten die Rheinland-PfÃ¤lzerinnen ihren Vorsprung bis zur 18. Minute auf 17 Punkte ausbauen (17:34) und mit einer 26:39-FÃ¼hrung in die Halbzeitpause gehen.</div>\r\n<div class="text"></div>\r\n<div class="text">Ab der 23. Minute (27:43) besannen sich die WÃ¼rzburgerinnen ihrer kÃ¤mpferischen QualitÃ¤ten und erhÃ¶hten den Druck in der Verteidigung. Jetzt machte sich bemerkbar, dass Mainz sich in der ersten Halbzeit offenbar verausgabt hatte. Jetzt hatten plÃ¶tzlich die BVUK-Damen die Ballgewinne und zogen immer wieder zum Korb.</div>\r\n<div class="text"></div>\r\n<div class="text">Vor dem letzten Viertel war der RÃ¼ckstand auf neun Punkte geschrumpft (41:50). Von nun an spielte die Heimmannschaft wie entfesselt auf, und Mainz wurde immer mehr verunsichert. Eine Minute vor Ende der Partie ging WÃ¼rzburg das erste Mal in FÃ¼hrung. Die stark spielende Mainzerin Devries vergab aber im Gegenzug beide FreiwÃ¼rfe und Lalonde stellte nach einem schnellen Foul mit zwei FreiwÃ¼rfen den ersten Saisonsieg der BVUK-Damen sicher.</div>', '2015-10-05 12:29:06', 'Zweite Basketball-Bundesliga der Damen: BVUK-Damen siegen nach Aufholjagd', 1268),
(8, 'http://lokalreporter.idvl.de/fussball-bayernliga-wuerzburger-fv-bleibt-nach-heimniederlage-gegen-hof-weiter-schlusslicht-1269/', 'In der FuÃŸball-Bayernliga findet der WÃ¼rzburger FV einfach nicht in die Erfolgsspur:\r\n\r\nAuch am 14. Spieltag muss man sich zuhause geschlagen geben, diesmal mit 1:4 gegen Bayern Hof. Bereits nach 18 Minuten steht es 0:2, Patrick Hofmann ist noch der beste WÃ¼rzburger und kann nach 67 Minuten den Ehrentreffer erzielen. In der Schlussphase dann die beiden letzten Treffer fÃ¼r die GÃ¤ste.\r\n\r\nIn der Hinrunde sind es nur noch 3 Spieltage â€“ und WÃ¼rzburg hat erst einen Saisonsieg auf dem Konto.\r\n\r\nMit nur 6 Punkten steht der WFV nach diesem 1:4 weiter auf dem letzten Tabellenplatz â€“ der Abstand zu einem Nichtabstiegsplatz betrÃ¤gt allerdings schon 9 ZÃ¤hler.\r\n\r\nKommenden Samstag spielt die Mannschaft von Trainer Marc Reitmaier erneut zuhause, dann gegen die zweite Mannschaft von Jahn Regensburg.', '2015-10-05 12:06:35', 'FuÃŸball-Bayernliga: WÃ¼rzburger FV bleibt nach Heimniederlage gegen Hof weiter Schlusslicht', 1269),
(9, 'http://lokalreporter.idvl.de/108745-1272/', 'Im Spitzenspiel der Tischtennis-Regionalliga gegen den TSV Ansbach standen die Versbacher von Anfang an unter Druck. Schnell stand es 5-2 fÃ¼r die GÃ¤ste und spÃ¤ter 7-4. Doch dann folgte die groÃŸe Aufholjagd der WÃ¼rzburger unter anderem mit einem Sensationssieg von Daniel Geist gegen den tschechischen Nationalspieler Thomas Pavelka, der auch schon in WÃ¼rzburgs Bundesliga-Mannschaft gespielt hat.\r\n\r\nSomit konnte Versbach sogar mit 8-7 in FÃ¼hrung gehen und die rund 130 Zuschauer standen Kopf und unterstÃ¼tzten ihr Team von Anfang bis zum Ende lautstark. Beim 8-7 fÃ¼r Versbach konnte das Schlussdoppel leider nicht gewonnen werden gegen die beiden ehemaligen deutschen Nationalspieler Wosik und Floritz. Somit endete die Partie mit einem 8-8 Unentschieden.\r\n\r\nFÃ¼r den SB Versbach war dies durchaus ein groÃŸer Erfolg, da man als Underdog gegen die Meisterschaftsfavoriten aus Ansbach an die Tische ging. Beide Teams stehen nach 2 Spielen punktgleich an der Tabellenspitze.', '2015-10-05 11:27:53', 'Tischtennis-Regionalliga: Versbach mit furioser Aufholjagd gegen Titelfavorit Ansbach', 1272),
(10, 'http://lokalreporter.idvl.de/tg-wuerzburg-baskets-akademie-starke-teamleistung-gegen-elchingen-wird-nicht-belohnt-1273/', '<b>Die TG WÃ¼rzburg Baskets Akademie unterliegt dem starken Aufsteiger mit 70:78 (39:42) â€“ Rund 40 FlÃ¼chtlinge machen Stimmung in der Feggrube</b><b>\r\n</b><b>\r\n</b><b>Bis 75 Sekunden vor der Schlusssirene war es ein intensives Duell auf AugenhÃ¶he, am Ende fiel die Niederlage um ein paar Punkte zu hoch aus: Die TG WÃ¼rzburg Baskets Akademie hat ihr erstes Heimspiel der neuen ProB-Saison gegen die ScanPlus Baskets Elchingen am Samstag mit 70:78 (39:42) verloren. TGW-Topscorer Felix Hoffmann (20 Punkte / 10 Rebounds) legte dabei ebenso wie Thomas Spagnolo (13 Punkte / 11 Rebounds) auf der Gegenseite ein â€žDouble-Doubleâ€œ auf.</b><b>\r\n</b>\r\nâ€žIch bin stolz auf die Mannschaft, weil sie bis zum Schluss intensiv gekÃ¤mpft und sich so eine Chance auf den Sieg erarbeitet hat. Wir kÃ¶nnen mit der Leistung insgesamt zufrieden seinâ€œ, so Peter GÃ¼nschel nach der hochspannenden Partie. Der TGW-Trainer musste im ersten Heimspiel auf Max Ugrai und die am Samstag verhinderten Christoph Henneberger und Sebastian Rauch verzichten. Davon war im Spiel nur selten etwas zu spÃ¼ren: Mit einer konzentrierten Teamleistung und intensiver Verteidigung agierten die WÃ¼rzburger gegen den mit vier Amerikanern besetzten Aufsteiger von Beginn an auf AugenhÃ¶he.\r\n\r\nDie ersten sieben Minuten verliefen vollkommen ausgeglichen (16:15), dann sorgte TGW-Youngster Noah Kleinschroth mit zwei erfolgreichen Dreiern in Folge erstmals fÃ¼r eine deutlichere FÃ¼hrung (22:15, 10. Minute). Die â€žElcheâ€œ - angefÃ¼hrt von ihrem starken Spielmacher Lorne Jackson in seinem ersten Saisonspiel â€“ schlugen zurÃ¼ck und gingen nach einem erfolgreichen zweiten Spielabschnitt mit einer knappen FÃ¼hrung in die Pause (39:42). Auch nach dem Seitenwechsel blieb es eine hart umkÃ¤mpfte und enge Partie mit vielen FÃ¼hrungswechseln â€“ kein Team konnte sich bis zur Schlussphase mehr als drei Punkte absetzen.\r\n\r\nEin Korbleger von TGW-Topscorer Felix Hoffmann exakt 75 Sekunden vor dem Ende zum 69:68 bedeutete die letzte WÃ¼rzburger FÃ¼hrung im Spiel. Filmore Beck antwortete im nÃ¤chsten Angriff mit einem Dreier zum 69:71. Danach konnten die Gastgeber gleich mehrere Chancen nicht nutzen, so dass Thomas Spagnolo erst per Freiwurf und dann mit einem Korbleger 27 Sekunden vor der Sirene auf 69:74 erhÃ¶hen konnte. Lorne Jackson und Filmore Beck sorgten im Anschluss durch vier weitere sicher verwandelte FreiwÃ¼rfe fÃ¼r die Entscheidung. Die FreiwÃ¼rfe waren in dem engen Spiel einer der SchlÃ¼ssel zum Sieg: Die TGW-Akteure trafen nur sechs FreiwÃ¼rfe bei 14 Versuchen (.43 Prozent), wÃ¤hrend die â€žElcheâ€œ 24 Treffer bei 31 Versuchen landeten (77 Prozent)\r\n\r\nPeter GÃ¼nschel: â€žAm Ende hat uns etwas die Erfahrung gefehlt, um das Spiel nach Hause zu bringen. Ich muss der Mannschaft aber ein Kompliment machen. Es war vorher nicht zu erwarten, dass wir gegen so einen starken Gegner so lange auf AugenhÃ¶he mithalten werden. Die Fehler, die wir nach unserer FÃ¼hrung in der Schlussphase gemacht haben, mÃ¼ssen wir aber noch abstellen.â€œ\r\n\r\n<b>40 FlÃ¼chtlinge sorgen fÃ¼r Stimmung in der Halle</b>\r\n\r\nFÃ¼r tolle Stimmung im Sportzentrum Feggrube sorgten rund 40 FlÃ¼chtlinge aus den WÃ¼rzburger Aufnahmeeinrichtungen, die die TGW Baskets Akademie im Rahmen einer gemeinsamen Aktion aller 40 Zweitligisten der ProA und ProB mit der â€žAktion Deutschland hilftâ€œ zum ersten Heimspiel eingeladen hatten. Die GÃ¤ste bedankten sich mit lautstarker Anfeuerung des Heimteams und â€žWÃ¼rzburg, WÃ¼rzburgâ€œ-SprechchÃ¶ren.\r\n\r\nDie 2. Basketball-Bundesliga und ihre Clubs wollen mit der Aktion ein klares Zeichen fÃ¼r dieÂ  FlÃ¼chtlingshilfe setzen. In WÃ¼rzburg kÃ¼mmern sich mehrere hundert ehrenamtliche Helfer seit Wochen in verschiedenen Aufnahmeeinrichtungen und NotunterkÃ¼nften um die Versorgung der NeuankÃ¶mmlinge. FlÃ¼chtlinge werden auch bei allen weiteren Heimspielen der TGW Baskets Akademie in der Feggrube willkommen sein. DarÃ¼ber hinaus haben die Liga und AusrÃ¼ster Molten acht BasketbÃ¤lle zur VerfÃ¼gung gestellt, die in KÃ¼rze an die WÃ¼rzburger Aufnahmeeinrichtungen Ã¼bergeben werden.\r\n\r\nDie s.Oliver Baskets haben zu ihrem ersten Beko BBL-Heimspiel der Saison gegen die GIESSEN 46ers am Mittwoch 50 ehrenamtliche FlÃ¼chtlingshelfer eingeladen. Schon beim Testspiel des Beko BBL-Aufsteigers gegen den FC Bayern MÃ¼nchen und beim Vorbereitungsturnier um den Bosch Rexroth Cup im September waren FlÃ¼chtlinge in der s.Oliver Arena zu Gast. Hauptsponsor s.Oliver hat eine LKW-Ladung mit Kleidung und Schuhen fÃ¼r FlÃ¼chtlinge in WÃ¼rzburg gespendet.\r\n\r\n<b>TGW Baskets Akademie â€“ ScanPlus Baskets Elchingen 70:78 (24:19, 15:23, 16:12, 15:24)</b>\r\n\r\n<b>FÃ¼r die TGW spielten:</b>\r\nFelix Hoffmann 20 Punkte/1 Dreier (10 Rebounds / 3 Steals), Constantin Ebert 10, Daniel Urbano 10 (9 Rebounds), Christian Hoffmann 9/2 (4 Assists), Noah Kleinschroth 8/2, Sebastian Lenke 8, Ferdinand Kleber 3/1, Mayika Linecker-Lungongo 2, Tim Leonhardt, Joanic GrÃ¼ttner Bacoul, Tobias Weigl.\r\n\r\n<b>Top-Perfomer Elchingen:</b>\r\nJackson 16 (7 Assists), Beck 14/3, Butler 14, Spagnolo 13/1 (11 Rebounds).', '2015-10-05 11:25:51', 'TG WÃ¼rzburg Baskets Akademie: starke Teamleistung gegen Elchingen wird nicht belohnt', 1273),
(11, 'http://lokalreporter.idvl.de/auswaertssieg-s-oliver-baskets-gewinnen-8678-in-ulm-1274/', 'Was fÃ¼r ein sensationeller Saisonauftakt der s.Oliver Baskets in der Beko Basketball-Bundesliga!\r\n\r\nDer Aufsteiger gewinnt mitÂ 78:86 und holt den ersten AuswÃ¤rtssieg in der Ulmer Arena!\r\n\r\nEin Ã¼berragender Brendan Lane sorgt mit einem Double-Double (26 Punkte, 10 Rebounds) fÃ¼r die Ãœberraschung beim letztjÃ¤hrigen Halbfinalisten.\r\n\r\nBest of Baskets: Brendan Lane 26 Punkte/1 Dreier (10 Rebounds, 4 Blocks), Dru Joyce 14/3 (7 Assists), Lamonte Ulmer 13.\r\n\r\n<strong>Die HÃ¶hepunkte der Partie zeigen wir natÃ¼rlich am Montag ab 18:30 in unserem Sport-Journal!</strong>', '2015-10-04 20:31:46', 'AuswÃ¤rtssieg! s.Oliver Baskets gewinnen 86:78 in Ulm!', 1274),
(12, 'http://lokalreporter.idvl.de/auswaertssieg-wuerzburger-kickers-gewinnen-bei-fortuna-koeln-1275/', 'Die WÃ¼rzburger Kickers haben in der 3. Liga Ihren hÃ¶chsten Saisonsieg einfahren kÃ¶nnen: die Mannschaft von Trainer Bernd Hollerbach gewinnt bei Fortuna KÃ¶ln mit 3:o.\r\n\r\nDie Treffer erzielen Nejmeddin Daghfous per Elfmeter (16.), Rico Benatelli (42.) und Adam Jabiri (51.), der im Sturm erneut den Vorzug vor Christopher Bieber bekommen hatte.', '2015-10-04 15:02:01', 'AuswÃ¤rtssieg: WÃ¼rzburger Kickers gewinnen bei Fortuna KÃ¶ln', 1275),
(13, 'http://lokalreporter.idvl.de/mountainbike-uwe-hardter-gewinnt-die-ritchey-challenge-2015-1276/', 'Matthias Leisling und Uwe Hardter vom unterfrÃ¤nkischen Mountainbike-Team Texpa-Simplon nahmen gemeinsam die Langstrecke beim 17. Feneberg MTB Marathon in Oberstdorf in Angriff, hatten dabei aber recht unterschiedliche Ziele im Blick. FÃ¼r Leisling war das Rennen vor allem als eine intensive Vorbereitung fÃ¼r die letzten groÃŸen Rennen der Saison geplant. Trotzdem erhoffte er sich natÃ¼rlich eine gute Platzierung. Bei Hardter ging es hingegen um die Gesamtwertung der Ritchey-Challenge, bei der er sich noch den Gesamtsieg holen konnte, wenn er beim Abschlussrennen in Oberstdorf genÃ¼gend Punkte sammeln wÃ¼rde.\r\n\r\nDie 63 km lange und mit 2200 hm versehene Strecke sorgte wie meistens fÃ¼r eine schnelle und deutliche Selektion des Feldes, so dass es schon nach dem ersten Berg keine grÃ¶ÃŸeren Gruppen mehr gab. Leisling merkte seine letzten Trainingseinheiten doch etwas mehr als vermutet und kam zunÃ¤chst nicht gut ins Rennen. Am ersten Gipfel lag er somit ca. 30s hinter der Spitze. Der Plan nun seine AbfahrtsstÃ¤rke einzusetzen, um wieder aufzuschlieÃŸen ging leider nicht ganz auf, da er dabei etwas zu motiviert ans Werk ging. Er rutschte in einer Kurve weg und ging zu Boden. Nachdem ein kurzer Material- und KÃ¶rpercheck positiv ausfiel, sprang er wieder aufs Bike und nahm das Rennen auf Platz 9 liegend wieder auf. Trotz seiner anfÃ¤nglichen Schwierigkeiten und seines Sturzes, fand er nun einen guten Rhythmus und holte sehr schnell einige Fahrer ein. Bis ins Ziel konnte er sein Tempo sehr gut durchziehen und schaffte es noch bis auf Rang 3 vorzufahren, so dass er bei der Siegerehrung ein weiteres Mal aufs Podest klettern durfte.\r\nHardter fand ebenfalls nicht gut ins Rennen, da er merkte wie die sehr lange Saison an seine Reserven ging. Trotzdem konnte er sich zunÃ¤chst in einer kleinen Gruppe um Platz 5 festsetzen. Zwar verlor er in der zweiten Abfahrt etwas den Anschluss, aber mit dieser Platzierung wÃ¼rde er genug Punkte fÃ¼r den Gesamtsieg sammeln. Daher gab er weiterhin Gas und versuchte gleichzeitig in den technischen Passagen auf Sicherheit zu fahren, um jetzt nicht noch einen Sturz oder Defekt zu riskieren. So brachte er mit einer soliden Leistung einen 6. Tagesrang ins Ziel. Damit konnte er sich dann auch den erhofften Gesamtsieg in der Ritchey-Challenge sichern.', '2015-10-01 16:19:57', 'Mountainbike: Uwe Hardter gewinnt die Ritchey-Challenge 2015', 1276),
(14, 'http://lokalreporter.idvl.de/tg-wuerzburg-baskets-akademie-heimpremiere-gegen-einen-top-favoriten-1277/', '<b>Nach dem verheiÃŸungsvollen Saisonstart mit einem 68:66-Erfolg bei den Saarlouis Royals darf die TG WÃ¼rzburg Baskets Akademie drei der nÃ¤chsten vier Spiele vor eigenem Publikum bestreiten. Los geht es am Tag der Deutschen Einheit um 20 Uhr im Sportzentrum Feggrube mit der Partie gegen Aufsteiger ScanPlus Baskets Elchingen.</b><b>\r\n</b>\r\nAls typischen Aufsteiger aus der Regionalliga kann man die â€žElcheâ€œ allerdings nicht bezeichnen: Die hohen Ambitionen im Landkreis Neu-Ulm zeigen sich unter anderem daran, dass Trainer Dario Jerkic nicht nur auf mehrere ProA-erfahrene deutsche Spieler, sondern auch auf vier US-Amerikaner setzen kann.\r\n\r\nBeim Auftakt-Heimsieg gegen die WeiÃŸenhorn Youngstars â€“ Elchingen setzte sich gegen Nils Mittmann und Co. knapp mit 70:68 durch â€“ ragten zwei von ihnen heraus: Shooting Guard Justin Martin erzielte 22 Punkte und holte sechs Rebounds, Power Forward Thomas Spagnolo war mit 19 Punkten, 7 Rebounds und 3 Ballgewinnen Ã¤hnlich auffÃ¤llig.\r\n\r\nâ€žIch halte sie fÃ¼r die Mannschaft, die in der ProB SÃ¼d am stÃ¤rksten aufgestellt ist. Sie haben mehrere ProA-erfahrene deutsche Spieler und vier gute AuslÃ¤nder. Sie haben einen guten Trainer und spielen guten Basketball. Es wartet eine schwierige Aufgabe auf unsâ€œ, sagt TGW-Coach Peter GÃ¼nschel. Seine junge Mannschaft geht als klarer AuÃŸenseiter in die Partie â€“ zumal GÃ¼nschel wegen des Saisonstarts in der Beko BBL auch noch nicht weiÃŸ, mit welcher Besetzung er am Samstagabend antreten kann.\r\n\r\nSprungball ist am Samstag um 20 Uhr im Sportzentrum Feggrube. Der Eintritt kostet 6 Euro (ermÃ¤ÃŸigt 4 Euro). Dauerkarteninhaber der s.Oliver Baskets zahlen nur 2 Euro.', '2015-10-01 16:16:11', 'TG WÃ¼rzburg Baskets Akademie: Heimpremiere gegen einen Top-Favoriten', 1277),
(15, 'http://lokalreporter.idvl.de/tauberbischofsheim-internationales-trainingslager-damenflorett-am-olympiastuetzpunkt-1278/', '<h3>Neue Impulse fÃ¼r Weltcup in Cancun</h3>\r\n&nbsp;\r\n\r\n<strong>Bei den Florett-Damen des FC Tauberbischofsheim steigt die Spannung: Die neue Fechtsaison beginnt. Zum Abschluss der Vorbereitung kamen die Top-Fechterinnen aus Ungarn, Polen und der Slowakei in den OlympiastÃ¼tzpunkt.</strong>\r\n\r\nDer Toto-Lotto-Cup in Mosbach ist der erste Termin im Saisonkalender der Florettfechterinnen aus Tauberbischofsheim. Wie in den vergangenen Jahren soll auch diesmal in der "Nachbarschaft" ein Sieg her. Erster HÃ¶hepunkt ist dann zwei Wochen darauf der Weltcup im mexikanischen Cancun. Dort messen sich die SchÃ¼tzlinge von Damenflorett-Bundestrainer Andrea Magro mit der Elite der Welt. Um bereits im Vorfeld eine reale WettkampfatmosphÃ¤re zu schaffen, lud das Fechtzentrum die Nationalfechterinnen aus Ungarn, Polen und der Slowakei zum gemeinsamen Training ein. Da alle Nationen mittlerweile eine kleinere Spitze am Topfechtern haben, Ã¼ben immer wieder die selben Athleten Gefechte zusammen. Eine solche Einladung verspricht daher eine willkommene Abwechslung. Neue Trainingspartner geben neue Impulse.\r\n\r\nCoach Magro freute sich Ã¼ber die qualitative VerstÃ¤rkung - schlieÃŸlich kÃ¤mpfen die GÃ¤ste auf AugenhÃ¶he mit ihren deutschen Gastgeberinnen. "Das ungarische Team ist sehr stark und Polen hat uns im Juni bei den Europaspielen in Baku geschlagen. Wir haben im Vorfeld viele Lektionen gemacht, im Trainingslager lag der Schwerpunkt dann auf Gefechten. Wir mÃ¼ssen die Chance nutzen, wenn wir so gute Ãœbungspartner hier haben."\r\n\r\nFÃ¼r einen besonderen Reiz sorgt die momentan laufende Olympia-Qualifikation fÃ¼r die Spiele in Rio de Janeiro 2016. Die beiden Ungarinnen Edina Knapek und Aida Mohamed sind nach derzeitigem Stand dabei, ebenso die Polin Hanna Lyczbinska sowie FC-Florett-Ass Carolin Golubytskyi. Auch Vereinskollegin Anne Sauer darf sich noch Chancen ausrechnen. Es ist ein wenig wie das Gesellschaftsspiel "Reise nach Jerusalem": Alle kÃ¤mpfen um die selben PlÃ¤tze. Und noch ist keine Teilnahme sicher. In Cancun ist also Punktesammeln angesagt.', '2015-10-01 16:14:15', 'Tauberbischofsheim: Internationales Trainingslager Damenflorett am OlympiastÃ¼tzpunkt', 1278),
(16, 'http://lokalreporter.idvl.de/saisonstart-am-sonntag-mit-ulmer-und-drei-ex-ulmern-nach-ulm-1279/', '<b>WÃ¼rzburg ist wieder da: Die s.Oliver Baskets starten zum ersten Mal auswÃ¤rts in eine neue Saison der Beko BBL â€“ Live-Premiere auf telekombasketball.de</b><b>\r\n</b><b>\r\n</b><b>Exakt 521 Tage nach ihrem letzten Beko BBL-Spiel am 1. Mai 2014 gegen medi bayreuth sind die s.Oliver Baskets zurÃ¼ck in Liga eins: Am Sonntag um 17 Uhr startet der Aufsteiger mit dem schweren AuswÃ¤rtsspiel beim Playoff-Kandidaten ratiopharm ulm in seine vierte Spielzeit in der Beko Basketball Bundesliga. Zum ersten Mal mÃ¼ssen die WÃ¼rzburger beim Saisonstart auswÃ¤rts ran: Die Partie in der Ulmer ratiopharm arena beginnt um 17 Uhr, die Live-Premiere der s.Oliver Baskets auf telekombasketball.de startet um 16:45 Uhr.</b>\r\n\r\nAlle Spieler freuen sich darauf, dass es endlich wieder losgeht â€“ fÃ¼r Lamonte Ulmer, einen der acht WÃ¼rzburger NeuzugÃ¤nge, dÃ¼rfte seine Premiere in der Beko BBL ein ganz besonderes Erlebnis werden: Die AnhÃ¤nger von ratiopharm ulm feuern ihre Mannschaft bekanntlich immer wieder lautstark mit dem Sprechchor â€žUuuulmerâ€œ an â€“ der WÃ¼rzburger FlÃ¼gelspieler wird seinen Namen also am Sonntag in der Halle wohl sehr hÃ¤ufig zu hÃ¶ren bekommen.\r\n\r\nFÃ¼r drei weitere Baskets-Akteure ist das Spiel eine RÃ¼ckkehr an ihre alte WirkungsstÃ¤tte: Dru Joyce, Sebastian Betz und zuletzt Cameron Long trugen in der Vergangenheit das Ulmer Trikot. Long hat mit muskulÃ¤ren Problemen einen groÃŸen Teil der Vorbereitung verpasst, konnte aber Anfang der Woche wieder ins Training einsteigen. â€žCam konnte im Training seine QualitÃ¤ten schon zeigen, mit ihm kÃ¶nnen wir eine ganz andere Rotation spielenâ€œ, sagt Headcoach Doug Spradley. Mit dem Zustand des Teams nach der Saisonvorbereitung ist er zufrieden: â€žUnsere Jungs sind kÃ¶rperlich in einer guten Verfassung nach der harten Vorbereitung. Ich freue mich, dass es losgeht. Im letzten Test gegen Ludwigsburg hatten wir die IntensitÃ¤t, die ich mir vorstelleâ€œ, so Spradley.\r\n\r\nDer Gegner zum Auftakt hat es in sich: ratiopharm ulm gehÃ¶rte in den vergangenen vier Jahren immer zu den besten sechs Teams der Liga, stand zweimal im Halbfinale und einmal sogar in der Endspiel-Serie um die Deutsche Meisterschaft. Auch aus dem direkten Vergleich wird klar, wer als Favorit in die Partie geht: Die s.Oliver Baskets konnten von bisher neun Beko BBL-Partien gegen Ulm nur ein Heimspiel gewinnen. Die letzten acht Begegnungen, darunter fÃ¼nf in der ratiopharm arena, gingen sÃ¤mtlich an die Gastgeber.\r\n\r\nTrainer Thorsten Leibenath erreichte mit seiner Truppe in der vergangenen Saison das Halbfinale gegen den spÃ¤teren Deutschen Meister aus Bamberg und krempelte den Kader mit Ausnahme von Spielmacher Per GÃ¼nther danach fast vÃ¶llig um. Mit dem GÃ¶ttinger Top-Scorer Raymar Morgan, David Brembly aus Bayreuth, dem athletischen Augustine Rubit aus TÃ¼bingen und Center Philipp Neumann (EWE Baskets Oldenburg) kamen gleich vier Spieler von anderen Beko BBL-Clubs nach Ulm. Shooting Guard Carlon Brown spielte vor einer lÃ¤ngeren Verletzungspause bei den Brose Baskets in Bamberg.\r\n\r\nâ€žDie Ulmer haben ein ganz anderes Team als letztes Jahr. Sie sind durch ihre Athletik und die QualitÃ¤t der einzelnen Spieler ein sehr gefÃ¤hrlicher Gegner. Ich hoffe, dass wir unser Spiel durchsetzen kÃ¶nnenâ€œ, sagt Doug Spradley vor der Saisonpremiere. Das Ziel der s.Oliver Baskets nach ihrem einjÃ¤hrigen Ausflug in die ProA: â€žWir mÃ¼ssen als Aufsteiger erst einmal unseren Platz in der Liga finden und wollen so frÃ¼h wie mÃ¶glich nichts mit den AbstiegsplÃ¤tzen zu tun haben.â€œ', '2015-10-01 15:51:40', 'Saisonstart am Sonntag: mit Ulmer und drei Ex-Ulmern nach Ulm', 1279),
(17, 'http://lokalreporter.idvl.de/2-basketball-bundesliga-der-frauen-bvuk-damen-starten-in-die-saison-1280/', 'Nach der Niederlage vom vergangenen Wochenende in Bad Homburg stellen sich dieÂ BVUK-Damen am SonntagÂ erstmals dem WÃ¼rzburger Publikum in eigener Halle vor.\r\n\r\nDie Mannschaft von Trainerin Janet Fowler-Michel hat ihr Gesicht stark verÃ¤ndert. Aus der vergangenen Saison sind Eva Barthel, Margret Pfister, Chaitlin Chiaramonte und die kanadische Aufbauspielerin Debbie Yeboah nicht mehr im Team. Mit â€žBecksâ€œ JÃ¤ger, Raphi Jochimczyk und Franzi Riedmann hat die Mannschaft drei Langzeitverletzte, die wahrscheinlich erst wieder nach der Weihnachtspause zur VerfÃ¼gung stehen werden.\r\n\r\nAls Ersatz fÃ¼r die letztjÃ¤hrige Topwerferin Yeboah haben die BVUK-Verantwortlichen Kristine Lalonde gefunden. Die Kanadierin war die vergangenen beiden Jahre mit ihrer Mannschaft kanadischer Meister und soll die neuformierte WÃ¼rzburger Mannschaft fÃ¼hren. Aus dem eigenen Nachwuchs rÃ¼ckt die 18 jÃ¤hrige Nina Wucherer auf. Auf der groÃŸen Position hat sich Johanna Beck vom oberfrÃ¤nkischen Rivalen DJK DonBosco Bamberg der TGW angeschlossen. FÃ¼r die amerikanische Centerspielerin Chiaramonte hat sich ebenfalls ein Ersatz gefunden. Stationiert mit der US-Army in Ansbach, wird Aritta Lane diese Saison fÃ¼r die BVUK-Damen unter dem Korb spielen. Als letzter Neuzugang steht noch Guilia ZÃ¶ller auf dem Roster. Sie kommt vom TV Marktheidenfeld, und wird wie Jule Elsner, Alex Daub, Franzi Kirchhoff und Elena Herold auch in der zweiten Mannschaft in der Regionalliga zum Einsatz kommen. Nach einem Jahr Pause ist auch Antonia Werner wieder mit im Team. Annette RieÃŸ, Sarah Wiegand und Chrissi Sokolowski vervollstÃ¤ndigen den Kader der Saison 2015/2016.\r\n\r\nDas Erreichen der Playoffs ist fÃ¼r das junge Team dieses Jahr wahrscheinlich nicht mÃ¶glich. Der Klassenerhalt ist das erklÃ¤rte Ziel der Mannschaft. â€žDie Mannschaft muss sich erst wieder finden, und die Rollen neu verteilen. Unsere komplette erste FÃ¼nf vom vergangenen Jahr steht nicht mehr zur VerfÃ¼gung. Die jungen Spielerinnen mÃ¼ssen lernen mehr Verantwortung, auch in wichtigen Phasen des Spiels, zu Ã¼bernehmen. Dazu brauchen wir sehr viel Geduld. Wenn es uns gelingt, bis Weihnachten guten Basketball zu spielen, wÃ¤ren wir als Trainer sehr zufriedenâ€œ, sagt HeadcoachÂ Janet Fowler-Michel.\r\n\r\n<strong>Spiel gegen Mainz</strong>\r\n\r\nAm Sonntag, um 15:30 Uhr, empfangen die BVUK-Damen der TG WÃ¼rzburg in der heimischen Feggrube den ASC Theresianum Mainz. Die Rheinland PfÃ¤lzerinnen starteten, wie das BVUK-Team mit einer deutlichen Niederlage gegen den Meisterschaftfavoriten Heidelberg in die Saison. Mit Gabriela Jandova und Maria Neufurth hat Mainz zwei sehr erfahrene Spielerinnen in ihren Reihen. Die beiden Kanadierinnen Laura Mortier und Vanessa Devries bilden das RÃ¼ckrad des ASC-Teams.\r\n\r\nFÃ¼r die BVUK-Damen geht es in erster Linie darum, den AufwÃ¤rtstrent der vergangenen Wochen fortzusetzten und die Minuten der guten Phasen im Spiel zu erhÃ¶hen. Nur mit einer verbesserten Teamverteidigung kann die Mannschaft von Trainerin Janet Fowler-Michel den ersten Sieg der neuen Saison landen.', '2015-10-01 15:03:49', '2. Basketball-Bundesliga der Frauen: BVUK-Damen starten in die Saison', 1280),
(18, 'http://lokalreporter.idvl.de/rimparer-woelfe-junge-hungrige-wiesel-aus-dormagen-zu-gast-1281/', '<p class=""><b>DJK Rimpar WÃ¶lfe - TSV Bayer Dormagen (Sa. 03.10. /Â 19 Uhr)</b></p>\r\nErinnern wird man sich bei den WÃ¶lfen gerne an jenes weihnachtliche Spektakel im letzten Jahr, als 2500 begeisterte Zuschauer in der brodelnden s.Oliver Arena einen 33:16-Kantersieg gegen den Gast vom Rhein feierten.Â  Die GÃ¤ste damals als Aufsteiger gegen den Abstieg kÃ¤mpfend ergaben sich schnell in ihr Schicksal, um sich auf das Punktesammeln vor eigenem Publikum zu fokussieren, doch das Team von TSV Trainer JÃ¶rg Bohrmann hat sich seitdem verÃ¤ndert und das nicht zum Schlechteren.\r\n\r\nSchon beim Saisonauftakt gegen Ferndorf wurde klar, dass es ihm nicht nur gelungen war, den Ausfall von einigen LeistungstrÃ¤gern neben RÃ¼ckraumwerfer Max Bettin zu kompensieren, sondern eine Truppe zu formen, die, durch junge Spieler aus dem eigenen Nachwuchs ergÃ¤nzt, selbstbewusst, technisch und taktisch versiert aufzutreten wusste. AngefÃ¼hrt vom aktuell fÃ¼hrenden der TorjÃ¤gerliste, Sebastian Damm,Â  fegte man beim Saisonauftakt den Aufsteiger aus Ferndorf mit 37:25 aus eigener Halle. Auch der knappe, aber verdiente 25:23-AuswÃ¤rtssieg beim Erstligaabsteiger Bietigheim lieÃŸ aufhorchen. Danach hatte zwar das Werksteam viermal denkbar knapp das schlechtere Ende fÃ¼r sich, ehe man Sonntag des vergangenen Doppelspieltages in der umkÃ¤mpften Partie gegen Aufsteiger Springe, sich in den Schlussminuten zwei wichtige Heimpunkte sichern konnte.\r\n\r\nNach der vermeidbaren Niederlage in Henstedt Ulzburg mÃ¼ssen sich die WÃ¶lfe erneut auf einen Gegner einstellen der das Tempospiel liebt und entsprechend flink auf den eigenen Beinen sein. Die Durchschlagskraft im Angriff zu verbessern ist der zweite Schwerpunkt bei den WÃ¶lfen in der Spielvorbereitung von DJK Trainer Matthias Obinger. Er erwartet in diesen Bereichen eine deutliche Verbesserung seiner Spieler, wobei die verletzungsbedingten AusfÃ¤lle des vergangenen Wochenendes dieses Bestreben erschweren werden. Jan Winkler wird mit seiner Kopfverletzung definitiv nicht dabei sein kÃ¶nnen und hinter Jan SchÃ¤ffer, sowie Lars SpieÃŸ stehen dicke Fragezeichen, wobei die medizinische Abteilung alles unternimmt um zumindest einen der beiden spielfÃ¤hig melden zu kÃ¶nnen. Schon deshalb darf man ein spannendes, ausgeglichenes Spiel gegen den Gast vom Rhein erwarten.\r\n\r\nGelingt es den Unterfranken, wieder an die kÃ¤mpferischen und spielerischenÂ  Elemente, die so kennzeichnend fÃ¼r das Spiel gegen Saarlouis und die letzten sensationellen Minuten gegen Essen waren, anzuknÃ¼pfen und steht das Publikum Ã¤hnlich geschlossen hinter ihren WÃ¶lfen, sollte es trotzdem mÃ¶glich sein, den Gegner niederzuringen.', '2015-10-01 14:55:10', 'Rimparer WÃ¶lfe: Junge hungrige Wiesel aus Dormagen zu Gast', 1281),
(19, 'http://lokalreporter.idvl.de/3-liga-wuerzburger-kickers-muessen-gegen-chemnitz-spaeten-ausgleich-hinnehmen-1285/', 'In der 3. Liga hat es fÃ¼r die WÃ¼rzburger Kickers wieder nicht zum Sieg gereicht: zuhause gegen den Chemnitzer FC bringt Dominik Nothnagel die Hausherren zwar frÃ¼h in FÃ¼hrung (9. Minute) und beendet damit die 402 Minuten lange Torflaute des Aufsteigers.\r\n\r\nTrotz zahlreicher Chancen kann die Mannschaft von Trainer Bernd Hollerbach allerdings den zweiten Treffer nicht nachlegen - in der 87. Minute kÃ¶nnen die GÃ¤ste dann mit einer Ihrer wenigen MÃ¶glichkeiten doch noch ausgleichen.\r\n\r\nKommenden Samstag muss WÃ¼rzburg bei Fortuna KÃ¶ln antreten - anschlieÃŸend geht es nach Bamberg.', '2015-09-26 22:40:31', '3. Liga: WÃ¼rzburger Kickers mÃ¼ssen gegen Chemnitz spÃ¤ten Ausgleich hinnehmen', 1285);
